about = "Имя: Даниэла\nВозраст: 20\nНациональность: Узбечка\nВес (кг.): 54\nРост (см.): 168\nГрудь: 4\nАнкета добавлена: 24.04.2021\nПросмотров анкеты: 128\n\nХочу растаять в твоих страстных и жарких объятьях. Хочу задыхаться от жара твоего дыхания на моей нежной упругой груди. Хочу извиваться от страсти пока ты входишь в меня. Если ты тоже этого хочешь, позвони мне."
